from django.http import JsonResponse
from django.views.decorators.http import require_http_methods

def train_choose(kind, traininfo):

    listfordict = []

    if kind == 'O':
        for item in traininfo:
            if item['trainID'][0] not in ['G', 'D', 'K', 'T', 'Z']:
                listfordict.append(item)
                # print("O")
                # print(item)

    else:
        for item in traininfo:
            if item['trainID'][0] == kind:
                listfordict.append(item)
                # print(kind)
                # print(item)

    return listfordict


def train_finish_choose(kinds, traininfo):

    listfordict = []

    for i in kinds:
        # print(i)
        listfordict += train_choose(i, traininfo)

    return listfordict



@require_http_methods(["GET"])
def zyh_choose_train(request):

    trainlist = request.GET.get('train')  # 获取字典进行筛选
    kinds = request.GET.get('kinds')  # 获取列表，列表中为种类


    listfordict = train_finish_choose(kinds, trainlist)
    response = {'data': listfordict}


    return JsonResponse(response)



def test(kinds, train):
    listfordict = train_finish_choose(kinds, train)
    # print("last")
    print(listfordict)



